import React from 'react';
import './Testimonials.css';

function Testimonials() {
  const testimonials = [
    /*{ quote: "This platform is amazing! I found the perfect freelancer for my project.", name: "John Doe" },
    { quote: "Great experience! I got hired for multiple projects quickly.", name: "Jane Smith" },
    { quote: "The payment processing is smooth and secure.", name: "Sarah Lee" }*/
  ];

  return (
    <section className="testimonials">
      <h2></h2>
      <div className="testimonial-list">
        {testimonials.map((testimonial, index) => (
          <div className="testimonial-item" key={index}>
            <p>"{testimonial.quote}"</p>
            <h4>- {testimonial.name}</h4>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Testimonials;
